import React from "react";
import Navbar from "./Navbar";

const Getinvolved=()=>{
    return(
        <>
        <Navbar />
        <div className="getinvolved_style">
            <h1>Get Involved</h1>
        </div>
        <div>
            <h3>You could play an important part in the shaping of a person’s future by…</h3>
        </div>
        </>
    );
}

export default Getinvolved;
